import React, { Component } from 'react';
import { Link } from 'react-router-dom'
import '../styles.css'
class Nav extends Component {

    state = {}
    render() {
        return (<div>
            <ul id='navList'>
                <li ><Link to='/'>Home</Link></li>
                <li><Link to='/about'>About</Link></li>
                <li><Link to='/contact'>Contact</Link></li>
            </ul>
        </div >);
    }
}

export default Nav;
